name: Max env var testing (130k)
on:
  push:
    paths:
      - .github/workflows/max-env-var-130k.yml
jobs:
  build:
    strategy:
      fail-fast: false
      matrix:
        runs-on:
          #- windows-latest
          - ubuntu-latest
          #- macos-latest
    runs-on: ${{ matrix.runs-on }}
    steps:
      - name: Test Bash
        if: ${{ always() }}
        run: echo "$LONG_ENV_VAR"
        shell: bash

      - name: Test Nodejs
        if: ${{ always() }}
        shell: node -- {0}
        run: console.log(process.env.LONG_ENV_VAR)

      - name: Test PowerShell Core
        if: ${{ always() }}
        shell: pwsh
        run: echo "$env:LONG_ENV_VAR"

      - name: Test PowerShell Desktop
        if: ${{ matrix.os == 'windows-latest' && always() }}
        shell: powershell
        run: echo "$env:LONG_ENV_VAR"

      - name: Test cmd.exe
        if: ${{ matrix.os == 'windows-latest' && always() }}
        run: SET LONG_ENV_VAR
        shell: cmd
    env:
      LONG_ENV_VAR: |
        
        
        
        
        
        
        
        
        
        
